// src/pages/HomePage.js
import React, { useEffect, useState } from 'react';
import { Container, Row, Col, Carousel, Button, Spinner, Alert } from 'react-bootstrap';
import axios from 'axios';
import Product from '../components/Product';

const HomePage = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading]   = useState(true);
  const [error, setError]       = useState(null);

  useEffect(() => {
    let ok = true;
    (async () => {
      try {
        const { data } = await axios.get('/api/products/');
        if (ok) setProducts((data || []).slice(0, 8));
      } catch (e) {
        if (ok) setError(e?.response?.data?.detail || e.message);
      } finally {
        if (ok) setLoading(false);
      }
    })();
    return () => { ok = false; };
  }, []);

  const banners = [
    { src: '/hero/banner1.jpg', title: 'Hydration • Radiance • Innovation', text: 'Curated Korean cosmetics delivered across Morocco.', cta: 'Discover our products' },
    { src: '/hero/banner2.jpg', title: 'Brands you’ll love', text: 'Top K-Beauty names, 100% authentic.', cta: 'Shop now' },
    { src: '/hero/banner3.jpg', title: 'Glow starts here ✨', text: 'Gentle formulas for sensitive skin.', cta: 'Browse' },
    { src: '/hero/banner4.jpg', title: 'Hydration heroes', text: 'Moisturizers and essences picked for you.', cta: 'See collection' },
    { src: '/hero/banner5.jpg', title: 'New arrivals weekly', text: 'Fresh stock, limited drops.', cta: 'Explore new in' },
  ];

  return (
    <>
      {/* WELCOME first */}
      <Container className="py-4 text-center">
        <h2 className="mb-2">Welcome to Your K-Beauty Shop</h2>
        <p className="text-muted m-0">
          Safe, effective routines for hydration, brightening and barrier repair — shipped fast.
        </p>
      </Container>

      {/* Cinematic banner */}
      <section className="home-hero">
        <Carousel fade interval={6000} pause="hover" indicators controls>
          {banners.map((b, i) => (
            <Carousel.Item key={i}>
              <img
                className="d-block w-100"
                src={b.src}
                alt={`Banner ${i + 1}`}
              />
              <Carousel.Caption className="text-left">
                <h2 className="mb-2">{b.title}</h2>
                {b.text && <p className="mb-3">{b.text}</p>}
                <Button variant="light" href="/products">{b.cta}</Button>
              </Carousel.Caption>
            </Carousel.Item>
          ))}
        </Carousel>
      </section>

      {/* Featured */}
      <Container className="py-5">
        <Row className="align-items-center mb-3">
          <Col><h4 className="m-0">Featured this week</h4></Col>
          <Col className="text-right">
            <Button variant="outline-secondary" size="sm" href="/products">See all</Button>
          </Col>
        </Row>

        {loading && <div className="d-flex justify-content-center py-5"><Spinner animation="border" /></div>}
        {error && <Alert variant="danger">{error}</Alert>}

        <Row>
          {products.map(p => (
            <Col key={p.id} xs={12} sm={6} md={4} lg={3} className="mb-4">
              <Product product={p} />
            </Col>
          ))}
          {!loading && !error && products.length === 0 && (
            <Col className="text-center text-muted py-5">No featured products yet.</Col>
          )}
        </Row>
      </Container>
    </>
  );
};

export default HomePage;
